create table dw_open_user_page_action
(
    id               bigint auto_increment comment '主键id'
        primary key,
    page_resource    varchar(255) not null comment '资源标识(AAA.BBB.CCC)',
    page_event       varchar(32)  not null comment '事件标识',
    action_user      varchar(255) not null comment '用户标识',
    action_time      datetime     not null comment '埋点行为时间',
    update_time      datetime     not null,
    create_time      datetime     not null,
    time_stamp       bigint       null,
    ip               varchar(50)  null comment '客户端ip',
    request_url      varchar(500) null comment '请求url',
    lessee_id        int          null comment '租户ID',
    operating_result tinyint      null comment '操作结果',
    request_params   mediumtext   null comment '请求参数',
    response_params  mediumtext   null comment '接口返回结果'
)
    comment '用户页面行为审计日志表;1、记录用户在后台页面操作行为的记录';

create index idx_lessee_id
    on dw_open_user_page_action (lessee_id);

